import { Outlet } from 'react-router-dom';
import Sidebar from '../Sidebar';

import './index.scss'

export default function Leyout() {
  return (
    <div className="App">
      <Sidebar />
      <div className="page">
        <span className="tags top-tags">numbers.reduce((acc, number) =&gt; &#10100;
          number % 2 === 0 ? &#10100; acc.even: ...acc.even, number &#10101
          : &#10100; acc.odd: ...acc.odd, number &#10101;
          &#10101;, &#10100;&#10101;);
        </span>

        <Outlet />

        <span className="tags bottom-tags">&lt;body&gt;
        </span>
        <br />
        <span className="bottom-tags-html">&gt;/html&lt;
        </span>

      </div>
    </div>
  )
}
